import React from "react";
import styles from "../../../css/Background.module.css";
import blueImg from "../../../img/blueImg.png";

const BackgroundCover = () => {
  return (
    <section>
      <img className={styles.blueImg} src="https://images.pexels.com/photos/1767016/pexels-photo-1767016.jpeg?auto=compress&cs=tinysrgb&w=600" alt="blueImg2"></img>
    </section>
  );
};

export default BackgroundCover;
